description:
Bumping locks

How to open Mul-T-Lock (pin-in-pin, interactive, 7x7), Assa (6000 Twin), DOM (ix, dimple with ball), LIPS (Octro dimple), Evva TSC, ISEO (dimple &amp; standard), Corbin, Pfaffenhain and a variety of other expensive mechanical locks without substantial damage, usually in under 30 seconds, with little training and using only inexpensive tools.

Barry Wels &amp; Rop Gonggrijp
Toool - The Open Organization Of Lockpickers
